import React, { Component } from 'react';
import {Table, Container, Row, Badge} from 'react-bootstrap';

import '../css/bootstrap.css';
import '../css/styles.css';

class Github extends Component{

  state = {
    datos : []
  }

  componentDidMount = async() => {
    const res = await fetch('https://api.github.com/users/cbrn/repos');
    const data = await res.json();

    this.setState({datos: data})
  }

  render(){
    return <Container style={{marginTop: '10%', marginBottom: '5%'}}>
      <h3 align="center">Proyectos <Badge variant="warning">PÃºblicos</Badge></h3>
      <Row>
      <Table striped bordered hover variant="dark">
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>
        <tbody>
          {
            this.state.datos.map(dato => {
            return <tr key>
              <td>1</td>
            </tr>
          })
          }
        </tbody>
      </Table>

      </Row>
    </Container>
  }
}

export default Github;
